```javascript
import * as React from 'react'
import Item from './Item'
import { DropTarget } from 'react-dnd'

type Props = {
  id: string | number,
  name: string | number,
  width: number,
  height: number,
  rows: number,
  style: any,
  activeStyle: any,
  canDrop: boolean,
  isOver: boolean,
  connectDropTarget: any,
  onChange: (state: State) => void,
}

const itemTarget = {
  drop(props: any, monitor: any, component: any) {
    const { id, name } = props
    const sourceObj = monitor.getItem()

    if (name === sourceObj.listName && id !== sourceObj.listId) {
      component.pushItem(sourceObj.item)
    }

    return {
      listId: id,
      listName: name,
    }
  },
}

@DropTarget('ITEM', itemTarget, (connect, monitor) => ({
  connectDropTarget: connect.dropTarget(),
  isOver: monitor.isOver(),
  canDrop: monitor.canDrop(),
}))
class Container extends React.Component<Props, State> {
  state = {
    list: [],
  }

  componentDidMount() {
    const { id, children } = this.props
    const newChildren = Array.isArray(children)
      ? [...children]
      : children
      ? [children]
      : []

    this.setState({
      list: newChildren.map((child, i) => {
        return {
          id: `${id}${i}`,
          child,
        }
      }),
    })
  }

  pushItem = (item: never) => {
    const { onChange = () => {} } = this.props
    const list = this.state.list.concat()
    list.push(item)

    this.setState(
      {
        list,
      },
      () => {
        onChange(this.state)
      }
    )
  }

  removeItem = (index: number) => {
    const { onChange = () => {} } = this.props
    let list = this.state.list.concat()
    list.splice(index, 1)

    this.setState(
      {
        list,
      },
      () => {
        onChange(this.state)
      }
    )
  }

  moveItem = (dragIndex: number, hoverIndex: number) => {
    let list = this.state.list.concat()
    const dragItem = list[dragIndex]
    const { onChange = () => {} } = this.props

    list.splice(dragIndex, 1)
    list.splice(hoverIndex, 0, dragItem)

    this.setState(
      {
        list,
      },
      () => {
        onChange(this.state)
      }
    )
  }

  render() {
    const {
      width = 200,
      height = 200,
      rows = 1,
      style,
      activeStyle,
      canDrop,
      isOver,
      connectDropTarget,
    } = this.props
    const { list } = this.state
    const isActive = canDrop && isOver
    const listStyle = isActive ? activeStyle : style

    return connectDropTarget(
      <div
        style={{
          ...listStyle,
          display: 'flex',
          width: width * rows,
          height: list.length ? height * Math.ceil(list.length / rows) : height,
          minHeight: height,
          overflow: 'auto',
          flexWrap: 'wrap',
        }}
      >
        {list.map((item: { id: number }, i) => {
          return (
            <Item
              key={item.id}
              index={i}
              item={item}
              listId={this.props.id}
              listName={this.props.name}
              removeItem={this.removeItem}
              moveItem={this.moveItem}
            />
          )
        })}
      </div>
    )
  }
}

export default Container
